    "    D = d_lst[ii]\n",
    "    x, y = make_grid_layout(n_wt=N, D=D, grid_spc=grid_spc)\n",
    "    xmax = max(x)\n",
    "    ymax = max(y)\n",
    "    area_km = (xmax/1000)*(ymax/1000)\n",
    "    print(area_km)\n",
